import React from "react";


function Nav() {
  return (
    <nav className="navbar navbar-light bg-light">
        <ul class="nav justify-content-center">
            <li class="nav-item">CLICKY GAME </li>
            <li class="nav-item">Click an image to start.</li>
            <li class="nav-item">
            Score: | Top Score:
            </li>

        </ul>

    </nav>
  );
}

export default Nav;
